import React from "react";
import "./App.css";
import Nav from "./Nav";
import "../styles/ContactUs.css";

function ContactUs() {
  return (
    <div>
      <Nav />
      <br />
      <br />
      <br />
      <br />
      <div className="body">
        <header>
          <h2 className="head"> Contact Us </h2>
          <div className="rowC">Levt</div>
          <div className="rowC">RRR</div>
        </header>
      </div>
    </div>
  );
}

export default ContactUs;
